description:
Starting from March 29, 2020, the Government of Cabo Verde has resricted the activities of businesses and enterprises on the territory of Cabo Verde.  
- catering services may continue to carry on home delivery activities between 10 am and 9 pm; 
- e-commerce home delivery services can maintain their activity between 8:00 am and 9:30 pm;
- services for the supply, distribution, sale and supply of food, including bakeries, hygiene and cleaning goods and other essential goods can maintain their activity until 8 pm.

